import React from "react";
import Site from "./Site";
import Header from "./Header";
import Content from "./Content";
import Footer from "./Footer";
import Router from 'next/router';

const Layout = ({ children }) => (
  <Site>
    <Header />
    <Content>
      <Router />
      {children}
    </Content>
    <Footer />
  </Site>
);

export default Layout;
